    [SysClientCacheDataMethodAttribute(true)]
    public display HoursPerDay displayHours1()
    {
        TSTimesheetLineWeek    timeSheetLineWeek;

        select sum(Hours) from timeSheetLineWeek where timeSheetLineWeek.TimesheetNbr == this.TimesheetNbr;

        return  timeSheetLineWeek.Hours[1] ;
    }

